script: |
  super -f text -I q329.spq | sort > q329.out

inputs:
  - name: q329.spq
    data: |
      SELECT DISTINCT col1 + + col2 - - + 3 + + 11 - 87 AS col0 FROM tab2 (FORMAT parquet) WHERE NOT + - 89 * - col1 * + col2 IS NULL;
  - name: tab2

outputs:
  - name: q329.out
    data: |
      1
      44
      52
